script: |
  super -f tsv -I q8516.sql | sort > q8516.out

vector: true

inputs:
  - name: q8516.sql
    data: |
      SELECT DISTINCT 6 AS col0 FROM tab1 AS cor0 WHERE + col2 + 60 + + - ( + col0 ) / + col2 NOT IN ( - + col2 + - + col0, + 67 * + 1, - 97, + + col2, CAST ( - + col0 AS INTEGER ) * - 18 );
  - name: tab1

outputs:
  - name: q8516.out
    data: |
      6
